In the future, as people with ESP increase in numbers, so does the possible good and evil they can cause to society. The Japanese government establishes of the Base of Backing ESP Laboratory (B.A.B.E.L.) for the purpose of appraising, identifying, nurturing, and protecting espers (even if that means apprehending those who engage in criminal activity). KÃ…ï¿½ichi Minamoto, a 20 year-old prodigy is assigned by B.A.B.E.L. to the task of supervising the most powerful espers in the country, a trio of gifted but mischievous 10-year-old girls known as &quot;The Children&quot;.

As the series progresses, The Children and Minamoto must deal with several enemy organizations, each with conflicted views regarding the role of espers in the world, including &quot;P.A.N.D.R.A.&quot;, a cadre of rogue espers determined to wage war against the rest of mankind, the &quot;Black Phantom&quot;, a mercenary organization who brainwashes espers into living tools of destruction and the &quot;Normal People&quot;, composed solely of non-esper individuals who view espers only as a threat to be vanquished.


